import { Redirect } from 'react-router-dom'
import { Helmet } from 'react-helmet';

const OnlineRegistration = () => {
    if (localStorage.getItem('access_token') === null){
        return <Redirect to = '/' />
    }
    return ( 
        <div className = 'admissions-officer'>
            <Helmet>
                <title>Online Registration | Fresherstrip</title>
            </Helmet>
            <p id = "steps-info-header">Online Registration</p>

            <div>
                <a href = 'https://umis.babcock.edu.ng/babcock/'><p style = {{
                textAlign: "center", 
                border: "1px solid #f1356d",
                width: "80%", 
                margin: "0 auto",
                maxWidth: "400px",
                padding: "15px",
                borderRadius: "10px",
                marginTop: "50px",
                color: "#f1356d"}}>Go to Online Registration</p></a>
            </div>
           
        </div>
    );
}
 
export default OnlineRegistration;
